<!DOCTYPE html>
<html lang="fa">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Contract Document</title>
    <style>

        @font-face {
            font-family: 'IranSans';
            src: url('data:font/woff2;base64,') format('woff2');
        }

        body, * {
            font-family: 'IranSans', sans-serif;
            direction: rtl;
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            -moz-font-feature-settings: "ss02";
            -webkit-font-feature-settings: "ss02";
            font-feature-settings: "ss02";
            letter-spacing: 0 !important;
        }

        .text-small {
            font-size: 12px;
            color: #333;
        }

        .header-content {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .header-left,
        .header-right {
            display: flex;
            flex-direction: column;
            gap: 5px;
        }

        .header-title {
            font-size: 1.5rem;
            font-weight: bold;
            text-align: center;
            margin: 0;
        }

        @page {
            margin: 20mm; /* فاصله عمومی محتوای صفحات */
        }

        .page-header, .page-header-space {
            height: 100px;
        }

        .page-footer, .page-footer-space {
            height: 50px;
        }

        .page-header, .page-footer {
            width: 100%;
            text-align: center;
        }

        .page-header {
            position: fixed;
            top: 0;
            width: 100%;
            border-bottom: 1px solid black; /* for demo */
        }

        .page-footer {
            position: fixed;
            bottom: 0;
            width: 100%;
            border-top: 1px solid black; /* for demo */
        }

        .page {
            page-break-after: always;
        }

        .content {
            padding: 20px;
        }

        .contract-section {
            font-size: 12px;
            line-height: 1.8;
            text-align: justify;
            margin-top: 1.5rem;
            word-wrap: break-word;
        }

        .article-title {
            font-weight: bold;
            font-size: 14px;
            display: block;
            margin-bottom: 0.5rem;
        }

        .article-content {
            display: block;
            margin-bottom: 0.5rem;
        }

        @media print {
            thead {display: table-header-group;}
            tfoot {display: table-footer-group;}

            body {margin: 0;}
        }
    </style>
</head>
<body>
<div class="page-header">
    <div class="header-content">
        <div class="header-left">
            <span class="text-small">بسم الله الرحمن الرحیم</span>
            <span class="text-small">
                            <span>کد ملک:</span>
                            <span>191981981</span>
                        </span>
        </div>
        <h2 class="header-title">«مبایعه نامه املاک»</h2>
        <div class="header-right">
            <span class="text-small">تاریخ: 594198</span>
            <span class="text-small">شماره قرارداد: 19619841984</span>
            <span class="text-small">کد ملکابی:</span>
        </div>
    </div>
</div>
<div class="page-footer">
    <span>تمامی حقوق محفوظ است. شماره تماس: 09121234567</span>
</div>
<table>
    <thead>
    <tr>
        <td>
            <div class="page-header-space"></div>
        </td>
    </tr>
    </thead>
    <tbody>
    <tr>
        <td>
            <div class="content">
                <div class="contract-section">
                    <p>
                        <span class="article-title">ماده 1- طرفین قرارداد:</span>
                        <br>
                        <span class="article-subtitle">1-1- فروشنده: </span>
                        <span class="party-info">
                    علی رضایی فرزند محمد به شماره شناسنامه 123456 صادره از تهران به کد ملی 0012345678 متولد 1365/05/23 با شماره تماس 09121234567 مالک 50 درصد مالکیت.
                </span>
                        <br>
                        <span class="article-subtitle">1-2- خریدار: </span>
                        <span class="party-info">
                    مهدی احمدی فرزند رضا به شماره شناسنامه 654321 صادره از مشهد به کد ملی 8765432100 متولد 1370/12/10 با شماره تماس 09127654321.
                </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p>
                        <span class="article-title">ماده 2- موضوع و مشخصات مورد معامله:</span>
                        <br>
                        <span class="article-content">عبارتست از انتقال</span>
                        <span class="party-info">
                    50 درصد مالکیت به نام علی رضایی
                    و 50 درصد مالکیت به نام مهدی احمدی
                </span>
                        <span class="article-content">
                    از دارایی با پلاک ثبتی اصلی 12345 پلاک ثبتی فرعی 6789
                    قطعه 3 واقع در بخش 12 حوزه ثبتی تهران به مساحت 200 متر مربع
                </span>
                        <span class="article-content">
                    دارای امکانات: برق، گاز و آب.
                </span>
                        <span class="article-content">
                    به نشانی تهران، خیابان ولیعصر، پلاک 123.
                </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">ماده 3- ثمن معامله: </span>
                        <br>
                        <span class="article-content">
            مبلغ 5,000,000,000 ریال معادل 500,000,000 تومان وجه رایج مملکت تعیین و مورد توافق و تراضی طرفین قرار گرفت که به شرح زیر از سوی خریدار پرداخت می‌گردد.
        </span>
                        <br>
                        <span class="article-content">
            مبلغ 3,000,000,000 ریال معادل 300,000,000 تومان بموجب چک به شماره صیادی 123456789 و شماره 987654321 به نام علی احمدی نزد بانک ملت در مورخ 1402/12/01 فی المجلس از ناحیه خریدار به فروشنده به عنوان تمام ثمن معامله پرداخت و فروشنده با امضای این مبایعه‌نامه اقرار به اخذ مبلغ فوق نموده است.
        </span>
                        <br>
                        <span class="article-content">
            مبلغ 2,000,000,000 ریال معادل 200,000,000 تومان توافق گردید که در مورخ 1402/12/15 به شماره کارت 1234-5678-9101-1121 و شماره حساب 123456789012 نزد بانک ملت به حساب علی احمدی انتقال یابد.
        </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">ماده 4- شرایط مربوط به سند:</span>
                        <br>
                        <span class="article-content">
            4-1- طرفین متعهد شدند جهت تنظیم سند، طبق قرارداد در تاریخ 1402/12/25
            در دفتر اسناد رسمی شماره 12345 شهرستان تهران حاضر شوند و
            فروشندگان متعهد گردیدند سند را به نام خریداران یا هرکسی که
            خریداران معرفی نمایند انتقال دهند.
        </span>
                        <br>
                        <span class="article-content">
            در ضمن اجرای تعهد به تنظیم سند از طرف فروشندگان به نام انتقال‌گیرنده بعدی،
            موکول به احراز انتقال از طریق ارائه قرارداد می‌باشد.
            درصورت عدم حضور هریک از طرفین در دفترخانه اسناد رسمی برای تنظیم سند،
            گواهی سردفتر مثبت تخلف نامبرده می‌باشد.
        </span>
                        <br>
                        <span class="article-content">
            4-2- عدم ارائه مستندات و مدارک لازم جهت تنظیم سند از طرف فروشندگان و
            عدم پرداخت ثمن از طرف خریداران، در حکم عدم حضور است و سردفتر
            در موارد مذکور مجاز به صدور گواهی عدم حضور می‌باشد.
        </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">ماده 5- شرایط تسلیم مورد معامله:</span>
                        <br>
                        <span class="article-content">
            5-1- فروشنده موظف است مورد معامله را در تاریخ 1402/12/30 با تمام توابع و ملحقات و منضمات آن تسلیم خریدار کند و هرگونه موانع در استیفا و بهره‌برداری کامل از مورد معامله را برطرف کند.
        </span>
                        <br>
                        <span class="article-content">
            5-2- در صورتیکه معلوم گردد معامله به جهت قوه قاهره قابلیت انتقال نداشته و این عامل مربوط به زمان انعقاد مبایعه‌نامه باشد، عقد باطل است و فروشنده موظف است ثمن دریافتی را به خریدار عودت دهد.
        </span>
                        <br>
                        <span class="article-content">
            5-3- در صورتیکه معلوم گردد مورد معامله به هر علتی غیر از عامل قوه قاهره مانند رهن، مصادره، عملیات اجرایی دادگستری و یا اجرای اسناد رسمی، مستحق‌للغیر و غصبی بودن قانوناً قابل انتقال به خریدار نبوده، فروشنده موظف است علاوه بر استرداد ثمن معامله، معادل
            500,000,000 ریال معادل 50,000,000 تومان به عنوان خسارت به خریدار بپردازد.
        </span>
                        <br>
                        <span class="article-content">
            5-4- کلیه هزینه‌های ناشی از تسلیم مورد معامله بر عهده فروشنده است، مگر اینکه به صورت دیگری توافق شده باشد.
        </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">ماده 6- آثار قرارداد:</span>
                        <br>
                        <span class="article-content">
            6-1- این قرارداد فروشنده را از هرگونه انتقال مورد معامله به هر عنوان و دلیل به غیر از خریدار منع می‌کند.
            در صورت تخلف و انتقال به غیر، خریدار حق خواهد داشت درخواست فسخ قرارداد را نموده و یا با اقامه دعوی ابطال به طرفیت فروشنده و منتقل‌الیه، الزام فروشنده را به انتقال مورد معامله بخواهد.
            در صورتی که الزام ممکن نباشد، خریدار حق فسخ معامله را دارد و فروشنده موظف است کلیه هزینه‌هایی که خریدار متقبل شده بپردازد و مبلغ
            500,000,000 ریال معادل 50,000,000 تومان به عنوان خسارت تخلف از عدم انجام تعهد به خریدار پرداخت نماید.
        </span>
                        <br>
                        <span class="article-content">
            6-2- فروشنده متعهد است قبلاً و یا حداکثر تا زمان مقرر برای تنظیم سند رسمی، کلیه مجوزها و مدارک لازم از مراجع مختلف در خصوص مورد معامله از قبیل مفاصا حساب شهرداری، مالیاتی و غیره را اخذ نماید.
        </span>
                        <br>
                        <span class="article-content">
            6-3- فروشنده مکلف است کلیه بدهی‌های احتمالی در خصوص توابع، اعیان، مستحدثاث و امکانات موجود در مورد معامله را حداکثر تا زمان تنظیم سند رسمی تسویه نماید.
        </span>
                        <br>
                        <span class="article-content">
            6-4- قیمت توافق شده برای معامله در ماده 3 به هیچ عنوان و به جهت نوسان قیمت مورد معامله قابل تغییر نیست و از این حیث حق و ادعایی برای فروشنده یا خریدار متصور نیست.
        </span>
                        <br>
                        <span class="article-content">
            6-5- کلیه خیارات از جمله خیار غبن به استثنای خیار تدلیس با اقرار طرفین اسقاط گردید.
        </span>
                        <br>
                        <span class="article-content">
            6-6- در صورتی که عدم اجرای تعهد از جانب فروشنده باشد، وی مکلف است به ازای هر روز تأخیر مبلغ 100,000 ریال معادل 10,000 تومان به عنوان خسارت به خریدار پرداخت نماید.
            در صورتی که ممتنع خریدار باشد، وی مکلف است به ازای هر روز تأخیر مبلغ 50,000 ریال معادل 5,000 تومان به عنوان خسارت تأخیر اجرای تعهد به فروشنده پرداخت نماید.
        </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">ماده 7:</span>
                        <br>
                        <span class="article-content">
            حق‌الزحمه مشاور املاک طبق تعرفه کمیسیون نظارت شهرستان بالمناصفه به‌عهده طرفین است که همزمان با امضای این قرارداد جمعاً مبلغ
            2,000,000 ریال معادل 200,000 تومان از طرفین نقداً بموجب قبض شماره 123456 نزد بانک ملت شعبه مرکزی به مسئول مشاوره املاک پرداخت گردد.
        </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">ماده 8:</span>
                        <br>
                        <span class="article-content">
            این قرارداد در تاریخ 1402/12/01 در دفتر مشاوره املاک "خانه‌ی امید" به نشانی تهران، خیابان آزادی، پلاک 12 در سه نسخه بین طرفین تنظیم و امضا و مبادله گردید.
        </span>
                        <br>
                        <span class="article-content">
            مشاور املاک موظف است ضمن ممهور نمودن نسخ قرارداد به مهر مخصوص مشاور، نسخه اول را در دفتر مخصوص بایگانی و نسخه دوم و سوم را به خریدار و فروشنده تسلیم نماید.
            هر نسخه دارای اعتبار یکسان است که با تنظیم سند رسمی از درجه اعتبار ساقط است.
        </span>
                    </p>
                </div>
                <div class="contract-section">
                    <p class="article">
                        <span class="article-title">توضیحات:</span>
                        <br>
                        <span class="article-content">
            این قرارداد با توافق کامل طرفین تنظیم شده و تمامی مفاد آن با دقت بررسی و تأیید گردیده است. خریدار و فروشنده هر دو اذعان دارند که مورد معامله هیچ‌گونه ابهام یا نقصی ندارد و تمامی تعهدات مرتبط به تسلیم مورد معامله و تنظیم سند رسمی به‌صورت شفاف در قرارداد ذکر شده است.
        </span>
                        <br>
                        <span class="article-content">
            فروشنده متعهد است که مورد معامله را در تاریخ مقرر با تمامی متعلقات و منضمات آن به خریدار تسلیم نماید. همچنین خریدار موافقت نموده است که تمامی تعهدات مالی مرتبط به معامله را در زمان‌های تعیین‌شده پرداخت کند.
        </span>
                        <br>
                        <span class="article-content">
            این قرارداد در نهایت حسن نیت بین طرفین منعقد گردیده و هرگونه ادعای احتمالی مرتبط به مفاد قرارداد تنها با توافق کتبی طرفین قابل بررسی خواهد بود.
        </span>
                    </p>
                </div>
            </div>
        </td>
    </tr>
    </tbody>
    <tfoot>
    <tr>
        <td>
            <div class="page-footer-space"></div>
        </td>
    </tr>
    </tfoot>
</table>
</body>
</html>
